import React from 'react';
import { Form } from 'react-bulma-components';
const { Input, Field, Control, Label } = Form;

const SearchForm = () => {
  return (
    <>
      <Form>
        <Field>
          <Label>Username</Label>
          <Control>
            <Input
              color="success"
              type="text"
              placeholder="Text input"
              value="bulma"
            />
          </Control>
        </Field>
      </Form>
    </>
  );
};

export default SearchForm;
